import React, { Component } from 'react';
import Header from './Containers/Header/Header';
import Banner from './Containers/Banner/Banner';
import Home from './Containers/Home/Home';
import Gallery from './Containers/Gallery/Gallery';
import Testimonials from './Containers/Testimonials/Testimonials';
import Footer from './Containers/Footer/Footer';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import ContentContext from './context/content-context'
import footerContext from './context/footer-context'

class App extends Component {

  render() {
    return (
      <div className="App">
        <ContentContext.Provider value={{
          main: [
            { id: 1, name: 'Developpeur Front-end' },
            { id: 2, name: 'Back-end' },
            { id: 3, name: 'Marketeur Digital' },
            { id: 4, name: 'Mes Projets' },
          ]
        }}>
          <Header />
          <Banner />
          <Home />
        </ContentContext.Provider>
        <Gallery />
        <Testimonials />
        <footerContext value={{
          front: [
            {
              id: 1, title: 'Développeur Front-End', content: [
                { id: 1, name: 'HTML' },
                { id: 2, name: 'CSS' },
                { id: 3, name: 'Javascript' },
                { id: 4, name: 'React' },
              ]
            }
          ],
          back: [
            {
              id: 1, title: 'Développeur Back-End', links: [
                { id: 5, name: 'Ruby' },
                { id: 6, name: 'Rails' },
                { id: 7, name: 'SQL' },
                { id: 8, name: 'MongoDB' },
              ]
            }
          ],
          marketing: [
            {
              id: 1, title: 'Marketing Digital', links: [
                { id: 1, name: 'SEO' },
                { id: 2, name: 'SEA' },
                { id: 3, name: 'Email Marketing' },
                { id: 3, name: 'Marketing de contenu' },
              ]
            }
          ],
        }}>
          <Footer />
        </footerContext>
      </div>
    );
  }
}

export default App;
